import { Layout, theme } from "antd";
import React from "react";
import { Card } from "react-bootstrap";

const AppContent = ({ changeSidebarColor, changeNavbarColor }) => {
  const { Content } = Layout;
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (  
    <div>
      <Content
        className="fs-5"
        style={{
          margin: "12px",
          padding: 24,
          height: "88vh",
          background: colorBgContainer,
        }}
      >
        {
          <Card
            bg="success"
            style={{
              width: "100%",
              color: "white",
              textAlign: "center",
            }}
            className="mb-2"
          >
            <Card.Header className="fs-4">Change Navbar Color</Card.Header>
            <Card.Body>
              <Card.Text
                style={{ width: "100%", display: "flex", flex: "20px" }}
              >
                muhammedbarad
                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#FF0000</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #FF0000",
                          borderRadius: "50%",
                          background: "#FF0000",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#FF0000")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#0000FF</Card.Header>

                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #0000FF",
                          borderRadius: "50%",
                          background: "#0000FF",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#0000FF")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#00FF00</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #00FF00",
                          borderRadius: "50%",
                          background: "#00FF00",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#00FF00")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#B24C63</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #B24C63",
