                          background: "#B24C63",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#B24C63")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#5438DC</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
