                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #32E875",
                          borderRadius: "50%",
                          background: "#32E875",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#32E875")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
