                        }}
                        onClick={() => changeNavbarColor("#D8D8D8")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#FFED66</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #FFED66",
                          borderRadius: "50%",
                          background: "#FFED66",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#FFED66")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#00CECB</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #00CECB",
                          borderRadius: "50%",
                          background: "#00CECB",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#00CECB")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>

                <Card
                  style={{
                    width: "150px",
                    borderRadius: "15px",
                    marginLeft: "5px",
                  }}
                >
                  <Card.Header className="fs-4">#A7A2A9</Card.Header>
                  <Card.Body
                    style={{
                      display: "flex",
                      justifyContent: "center",
                      width: "70%",
                      textAlign: "center",
                    }}
                  >
                    <Card.Text>
                      <input
                        style={{
                          width: "50px",
                          height: "50px",
                          border: "1px solid #A7A2A9",
                          borderRadius: "50%",
                          background: "#A7A2A9",
                          marginLeft: "40px",
                          textAlign: "center",
                        }}
                        onClick={() => changeNavbarColor("#A7A2A9")}
                        type="submit"
                        value=""
                      />
                    </Card.Text>
                  </Card.Body>
                </Card>
              </Card.Text>
            </Card.Body>
          </Card>
        }
        {
          <Card
            bg="success"
            style={{
              width: "100%",
